import React from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
import { AdminRoute } from "./AdminRoute";

  export default function AdminRouter() {
    return (
        <div>
            <ul>
                {
                    AdminRoute.map(item => {
                        return <li>
                                <Link to={item.path}>{item.label}</Link>
                            </li>
                    })
                }
            </ul>

            <hr />
            <Switch>
                {
                    AdminRoute.map(item => {
                        return <Route path={item.path}>
                        {item.component}
                    </Route>
                    })
                }
            </Switch>
        </div>
    );
}
